import React from 'react'
import { useFetch } from './useFetch'

function Reserve({setOpen, hotelId}) {
    const {data, loading, error} = useFetch(`http://localhost:8800/api/hotels/rooms/{64e875727f4cfbbd4a2a6b22}`)
  return (
    <div className="Reserve">
        <div className="reserveContainer">
            <div className="reserveClose" onClick={() => {setOpen(false)}}>Close</div>
            <span className="reserveRooms">Select your Rooms: </span>
        </div>
    </div>
  )
}

export default Reserve
